import * as React from "react";
import { useEffect } from "react";
import { getData } from "../../utils/getData";
import { ContributionBox, Container } from "./style";

function Contribution({ data }: any) {
  console.log(data);
  const dateList = Array(365)
    .fill(undefined)
    .map((_, idx) => {
      return <li></li>;
    });

  console.log(dateList);

  const findWrittenDateIndex = data.map((el: any) => {
    if (el.date.includes("2022")) {
      const dDay =
        new Date(el.date).getTime() - new Date("2022.01.01").getTime();
      const dDayF = dDay / 86400000;
      return dDayF + 1;
    }
  });

  return (
    <Container>
      <h3>기록일</h3>
      <ul className="month">
        <li>1월</li>
        <li>2월</li>
        <li>3월</li>
        <li>4월</li>
        <li>5월</li>
        <li>6월</li>
        <li>7월</li>
        <li>8월</li>
        <li>9월</li>
        <li>10월</li>
        <li>11월</li>
        <li>12월</li>
      </ul>
      <ContributionBox>{dateList}</ContributionBox>
    </Container>
  );
}
export default Contribution;
